public IneqMesh GetIneqMesh()
{
    return new IneqMesh
    {
        X0 = -1.0,
        Y0 = -1.0,
        Z0 = -1.0,
        X1 = 1.0,
        Y1 = 1.0,
        Z1 = 1.0,
        D = 0.05d,
        Boxed = false,
        IneqTree =
          (
          (IneqTree)
          ((x, y, z) => x * x + y * y + z * z - ((Math.Cos(9 * x) + Math.Cos(9 * y) + Math.Cos(9 * z)) / 6.0 + 0.6)) |
          ((x, y, z) => x * x + y * y + z * z - ((Math.Sin(9 * x) + Math.Sin(9 * y) + Math.Sin(9 * z)) / 6.0 + 0.6))
        ) &
          (IneqTree)((x, y, z) => x - 0.1)
      };
}
